let rooms = {}

msg.payload.forEach(room => {
    node.status({text: room.id, fill: "green", shape: "dot"})
    rooms[room.id] = room
})

global.set("rooms", rooms)
return {payload: rooms}

let scenes = {}
let rooms = global.get("rooms") || {}
let zones = global.get("zones") || {}

let findGroup = (id, groups) => {

    for (let rid in groups) {

        let group = groups[rid]

        if (group.id == id) {
            return group
        }
    }

    return undefined
}

msg.payload.forEach(scene => {

    let status = scene.id

    scenes[scene.id] = scene

    let group = findGroup(scene.group.rid, zones)

    if (group === undefined) {
        group = findGroup(scene.group.rid, rooms)
    }

    if (group !== undefined) {
        scene.group.name = group.metadata.name
        status = scene.group.name
    }

    let services = group.grouped_services

    for (let index = 0; index < services.length; ++index) {

        let service = services[index]

        if (service.rtype == "grouped_light") {
            scene.group.grouped_light = service.rid
        }
    }

    node.status({text: status, fill: "green", shape: "dot"})

})

global.set("scenes", scenes)
return {payload: scenes}

let zones = {}

msg.payload.forEach(zone => {
    node.status({text: zone.id, fill: "green", shape: "dot"})
    zones[zone.id] = zone
})

global.set("zones", zones)
return {payload: zones}

let groups = {}

let findContainer = (groupId, containers) => {

    for (let containerId in containers) {

        let container = containers[containerId]

        let services = container.grouped_services

        for (let index = 0; index < services.length; ++index) {

            let service = services[index]

            if (service.rid == groupId) {
                return container
            }
        }
    }

    return undefined
}

msg.payload.forEach(group => {

    let container = findContainer(group.id, global.get('rooms'))
    let status = group.id

    if (container === undefined) {
        container = findContainer(group.id, global.get('zones'))
    }

    if (container !== undefined) {
        group.containerName = container.metadata.name
        group.containerType = container.type
        status = group.containerName
    }

    node.status({text: status, fill: "green", shape: "dot"})
    groups[group.id] = group
})

global.set("groups", groups)
return {payload: groups}
